import React from 'react'

const MovieCard = (movie) => {
    return (
        <div className="movie-card">
            <div className="overlay"></div>

            <img
                src={`https://image.tmdb.org/t/p/w200${movie.poster_path}`}
                alt={`${movie.title} Poster`}
            />
        </div>
    )
}

export default MovieCard
